import React from 'react'

function App() {
  return (
    <div>
      <div className="min-h-screen mx-auto p-10 flex text-center items-center justify-center align-items">
        <div className="bg-blue-500 text-white">
          Hello World!
        </div>
      </div>
    </div>
  )
}

export default App
